define('text!views/cart-view.html', ['module'], function(module) { module.exports = "<template><require from=\"../valueConverters/integer-value-converter\"></require><div class=\"cd-cart-container ${cart.totalCartItens > 0 ? 'cart-open' : 'empty' }\"><div class=\"shadow-bkg\"></div><a href=\"#\" class=\"cd-cart-trigger\">Cart<ul class=\"count\"><li>${cart.totalCartItens}</li><li>${cart.totalCartItens}</li></ul></a><div class=\"cd-cart\"><div class=\"wrapper\"><header><h2>Carrinho de compras</h2><span class=\"undo\">Item removed. <a href=\"#0\">Undo</a></span></header><div class=\"body\"><ul><li class=\"product\" repeat.for=\"cartItem of cart.itens\"><div class=\"row\"><div class=\"col-xs-12 col-sm-12 col-md-6 col-lg-3\"><div class=\"product-image\"><img src=\"assets/images/products/${cartItem.product.id}.jpg\" alt=\"${cartItem.product.title}\"></div></div><div class=\"col-xs-12 col-sm-12 col-md-6 col-lg-9\"><div class=\"product-details\"><h3>${cartItem.product.title}</h3><div class=\"price-container\"><span class=\"currency\">${cartItem.product.currencyFormat}</span> <span class=\"price\">${cartItem.totalValue}</span></div><div class=\"actions\"><a href=\"#\" class=\"delete-item\" click.delegate=\"onRemoveProducts(cartItem.product)\"><i class=\"fa fa-trash\"></i></a><div class=\"quantity\"><label>Qtd</label><span class=\"select\"><input type=\"number\" value.bind=\"cartItem.qtd | integer\" style=\"width:50px\" disabled=\"disabled\"> <button class=\"btn btn-xs\" click.delegate=\"addItemCart(cartItem)\" style=\"margin:0 0 8px 0;padding:0 8px;font-size:1.3em;background-color:#2c97de\">+</button> <button class=\"btn btn-xs\" click.delegate=\"removeItemCart(cartItem)\" style=\"margin:0 0 8px 0;padding:0 8px;font-size:1.3em;background-color:#2c97de\">-</button></span></div></div></div></div></div></li></ul></div><footer><a href=\"#\" class=\"checkout\"><em>Finalizar compra - R$<span>${cart.totalCart}</span></em></a></footer></div></div></div></template>"; });
